import React, {Component} from 'react';
import {getStatic, checkLogin, get} from './utilities';
var kk = {
    margin : "-10px"
        }
var lk = {
    height : "100%"
}

export default class Home extends React.Component {
    constructor(props){
        super(props);
        this.state = {};
    }

    async componentWillMount() {
        this.setState({
            isLoggedIn: await checkLogin()
        });
    }
  getprofile(){
      get('/data/user/get', {'Content-Type':'application/json'})

  }
    render() {
        if(this.state['isLoggedIn']){
            return  (<div style={lk}><center> <img src={getStatic("/index.png")} width="30" height="30" style={kk}/> &nbsp;&nbsp;&nbsp; Instagram &nbsp; &nbsp; &nbsp;&nbsp;
                <input type="text" placeholder="search"/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
            <a><img src={getStatic("/images.png")} onClick={getprofile} width="30" height="30" style={kk}/></a></center>
            </div>
            );    
        }   else    {
            // Redirect To Login
            return (<div>You are not logged in</div>);
        }

    } 
}
